import React from 'react';

function Spiritopportunity(props) {
    return (
        <div className="so-container">
            <div className="section-1">
                <h1>Spirit and Opportunity</h1>
                <div className="d-flex justify-content-center">
                    <iframe src='https://mars.nasa.gov/layout/embed/model/?s=3&rotate=true' width='800' height='450'
                            scrolling='no' frameBorder='0' allowFullScreen />
                </div>
                <h3>Twins that defied death</h3>
                <p>Landing on January 3rd and 24th 2004 respectively,
                    Spirit and Opportunity surpassed their planned 90-day mission on mars.
                </p>
            </div>

            <div className="section-2">
                <h3></h3>
            </div>

        </div>

    );
}

export default Spiritopportunity;
